function CommonLogin() {    
    return (
      <> 
        <div id="modal">
            <h4>Сіз кімсіз?</h4>
            
            <div className="card" style="width:18rem;">
  <img src={"https://i.pinimg.com/736x/18/65/49/186549476b8aa1426ab2e627ce512ecb.jpg"} alt="..." width="200px" height="200px"/>
  <div className="card-body">
    <p className="card-text">Teacher</p>
  </div>
</div>
            
            <div id="image2">
              <img alt="ss" src={"https://i.pinimg.com/736x/18/65/49/186549476b8aa1426ab2e627ce512ecb.jpg"} width="100px" height="100px" />
              <h5>Студент</h5>
            </div>
        </div>  
  
      </>
    );
  }
  
  export default CommonLogin;
